                <h1>{bet.User.username}</h1>
                <p>
                    ${bet.amount}: {bet.betTeam} +{bet.line} ({bet.betType} vs. {bet.opposingTeam}
                </p>
                <p>
                    Reason: {bet.reason}
                </p>
            </div>

        </div>
    )
}

export default SongRow
